import  { Link } from "react-router-dom"
const style = {
    textDecoration: "none"
}

function Nav() {
  return (
    <nav>
        <ul style={style}>
            <li>Home</li> 
            <li>Impressum</li>
            <li>Help</li>
        </ul>
    </nav>
  );
}

export default Nav;
